import React from 'react';
import './Edu.css';

function Edu(){
    return(
        <div>
            <div>
                <h1>Education</h1>
            </div>
            <div>
                <h2>University of Maryland College Park</h2>
                <h3>Computer Engineering, graduated Fall 2019</h3>
                <h5>GPA (4 scale)</h5>
                <p>3.8</p>
                <h5></h5>
            </div>
        </div>
    )
}

export default Edu;
